package DSA150Questions;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class FindAll_Anagrams_in_a_String {
    public static void main(String[] args) {
        String s = "";
        String f = "";
        List<Integer> integers = FindAll_Anagrams_in_a_StringAns(s, f);
        System.out.println(integers);
    }

    private static List<Integer> FindAll_Anagrams_in_a_StringAns(String s, String f) {
        char[] arr = s.toCharArray();
        int n = arr.length;
        int i = 0, j = 0;
        int k = f.length();
        Map<Character, Integer> map = new HashMap<>(f.length());
        for (int m = 0; m < k; m++) {
          map.put(f.charAt(m),map.getOrDefault(f.charAt(m),0)+1);
        }
        List<Integer> ans = new ArrayList<>();
        int count = map.size();
        while (j < n) {
            // calculation
            if (map.containsKey(arr[j])) {
                map.put(arr[j], map.get(arr[j]) - 1);
                if (map.get(arr[j]) == 0) {
                    count--;
                }
            }
            // condition
            if (j - i + 1 == k) {
                if (count == 0) {
                    ans.add(i);
                }
                // removing effect on i
                if (map.containsKey(arr[i])) {
                    map.put(arr[i], map.get(arr[i]) == 0 ? 1 : map.get(arr[i]) + 1);
                    if (map.get(arr[i]) > 0) {
                        count++;
                    }
                }
                j++;
                i++;
            } else {
                j++;
            }
        }
        return ans;
    }
}
